import './Home.css'
import { DownOutlined } from '@ant-design/icons'
import { useState } from 'react'

function Home() {
const [menu, SetMenu] = useState(false)

const toggleMenu = () => {SetMenu(!menu)}

    return (
        <>
            <div className="container">
                <div>
                    <p>EXERCISES</p>
                    <button><DownOutlined/></button>
                </div>
                <a href="/exercises" className='item'>EXERCISES<DownOutlined id="downout" /></a>
                <a href="/supplementation" className='item'>SUPPLEMENTATION<DownOutlined id="downout" /></a>
            </div>
        </>
    )
}

export default Home
